import React from "react";
import UserBoard from "./userboard";

function LocalBoard() {
    let user = JSON.parse(localStorage.getItem("user"));
    let username = user.name + "321";

    return (
        <>
            <UserBoard rank="1" image="../../assets/images/user1.png" name="Adarsh" username="ersdfvr" level="24" location="INDIA" leaves="12442" />
            <UserBoard rank="2" image="../../assets/images/user1.png" name="Raju" username="ersdfvr" level="24" location="INDIA" leaves="12442" />
            <UserBoard rank="3" image="../../assets/images/user1.png" name="Shivam" username="ersdfvr" level="24" location="INDIA" leaves="12442" />
            <UserBoard rank="4" image="../../assets/images/user1.png" name="Shrey" username="ersdfvr" level="24" location="INDIA" leaves="12442" />
            <UserBoard rank="5" image="../../assets/images/user1.png" name="Kunal" username="ersdfvr" level="24000" location="INDIA" leaves="1209442" />
            <div className="you-board">
                <UserBoard rank="108" image="../../assets/images/user1.png" name={user.name} username={username} level="24000" location="INDIA" leaves="1209442" />
            </div>
        </>
    )
}

export default LocalBoard;
